DROP TABLE IF EXISTS `comments`;
CREATE TABLE `comments` (
  `id` int NOT NULL AUTO_INCREMENT,
  `topic` int NOT NULL,
  `body` varchar(255) COLLATE utf8mb4_general_ci NOT NULL,
  `op` int NOT NULL,
  `timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `topic` (`topic`),
