DROP TABLE IF EXISTS `topics`;
CREATE TABLE `topics` (
  `id` int NOT NULL AUTO_INCREMENT,
  `op` int NOT NULL,
  `category` int NOT NULL,
  `title` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `body` mediumtext COLLATE utf8mb4_general_ci NOT NULL,
  `timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `locked` tinyint NOT NULL DEFAULT '0',
  `pinned` tinyint NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

INSERT INTO `topics` (`id`, `op`, `category`, `title`, `body`, `timestamp`, `locked`, `pinned`) VALUES
(28,	53,	1,	'General chat thread!',	'Post about anything here, make conversation!',	'2024-08-21 08:30:17',	0,	0),
(29,	53,	1,	'Welcome to the PBS General Board!',	'Please keep all posts on-topic and civil!',	'2024-08-21 08:30:45',	1,	1),
(30,	8,	1,	'When were you first introduced to Welcome to ROBLOX Building?',	'Just wondering who here is an OG player.',	'2024-08-21 08:32:10',	0,	0),
(36,	53,	1,	'Rules',	'Rules\r\n1: Abide by the ROBLOX Terms of Service.\r\n2: Be kind and respectful towards everyone.\r\n3: Do not insult or provoke others.\r\n4: Do not be disruptive or attempt to derail the chat.\r\n5: Discrimination of any kind (including against racial, sexual, or religious identity) is prohibited.\r\n6: No NSFW content.\r\n7: No ban evasion.\r\n8: No excessive cursing.\r\n9: No politics. Politics relating to personal servers is fine, but real world politics should not be discussed in this server.\r\n10: Use common sense. Just because it is not listed in the rules doesn\'t mean it is allowed.\r\nThese rules are subject to change.\r\n\r\nAdditionally, if you think someone should be banned but doesn\'t violate any specific rule, please contact an administrator privately.',	'2024-08-22 07:50:34',	1,	1),
(40,	60,	2,	'Milk',	'Why is there so many types of milk? Cashew, oat, almond, cow, goat, sheep, coconut, soy, and rice. Who the hell though they needed that many milk types!! Why couldn\'t people be content with cow\'s milk and oat milk as a plant based option. And while on the topic of milk, wouldn\'t it be more normal for people to consume breast milk? Cow\'s don\'t say \"hmm, I don\'t like this cow milk anymore. I\'m gonna go see if I can milk a human\". That\'d be weird. Next you\'ll have almonds trying to milk goats. That wouldn\'t work.\r\nAnd if it\'s weird to have human breast milk, or even inhumane, why is it normal to have the milk of another mammal?\r\nThat\'s all. Toodles milkers.',	'2024-08-27 22:07:34',	0,	0),
(42,	53,	2,	'Welcome to Off Topic!',	'Talk about anything within the rules here.',	'2024-08-27 22:11:09',	0,	1);

DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int NOT NULL AUTO_INCREMENT,
  `username` varchar(16) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `hash` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `iconFile` mediumblob NOT NULL,
  `iconType` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'image/png',
  `moderator` tinyint NOT NULL DEFAULT '0',
  `admin` tinyint NOT NULL DEFAULT '0',
  `status` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'Hello world!',
  `bio` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'Welcome to my profile.',
  `joined` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `banned` tinyint NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

